    scannersTab,
    validatorsTab,
    brandsCatalog,
    unitsCatalog,
    groupsCatalog,
    linesCatalog,
    chainsCatalog,
    regionsCatalog,
    usersCatalog,
    graphTabCompare,
    statisticReport,
    productReport,
    scansReport,
}
